  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Fish and Wildlife Service proposes
  limited hunting opportunities at North Platte NWR. Hunting activities will be permitted,
  but administratively limited to those areas specified in the refuge-specific regulations.
  \ This decision document package contains the Hunting Plan, and Environmental Action
  Memorandum stating that establishing a hunting program is found not to have significant
  environmental effects as determined by the Environmental Assessment, Section 7 Evaluation
  and Finding of No Signiflcant Impact.  The limited hunting opportunities that will
  be conducted, in accordance with State and Special Refuge regulations, are 1) archery
  deer, and 2) for youth only, the following species: squirrel, rabbit, pheasant,
  coyote, and fur bearers.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
